// About.js
import React from 'react';
import { Link } from 'react-router-dom';

function About() {
  return (
    <div>
      <h1>About Page</h1>
      <p>You are currently on the About page.</p>
      <nav>
        <Link to="/">Go to Home Page</Link>
      </nav>
    </div>
  );
}

export default About;
